import React, { useEffect, useState } from 'react'
import { StyleSheet, View, TextInput } from 'react-native'

const SearchScreen = () => {
  return (
    <View>
      <TextInput style={textInput} />
    </View>
  )
}

const styles = StyleSheet.create({
  mainView: {
    justifyContent: 'center',
    padding: 10,
    backgroundColor: 'white'
  },
  characterContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    marginVertical: 5
  },
  characterImage: {
    width: 90,
    height: 90,
    marginRight: 10
  },
  textInput: {
    borderWidth: 1,
    borderColor: '#CCCCCC',
    height: 35,
    padding: 5
  },
})

export default SearchScreen
